import java.util.*;

class Solution {
    static final int MOD = 1000000007;

    private static int primeScore(int n) {
        Map<Integer, Integer> primeFactors = new HashMap<>();
        for (int i = 2; i <= n / i; ++i) {
            while (n % i == 0) {
                primeFactors.put(i, primeFactors.getOrDefault(i, 0) + 1);
                n /= i;
            }
        }
        if (n > 1) primeFactors.put(n, 1);
        return primeFactors.size();
    }

    public int maximumScore(List<Integer> nums, int k) {
        List<int[]> scores = new ArrayList<>();
        for (int num : nums) {
            scores.add(new int[]{primeScore(num), num});
        }

        scores.sort((a, b) -> {
            if (b[0] != a[0]) return b[0] - a[0];
            return b[1] - a[1];
        });

        long result = 1;
        for (int i = 0; i < k && i < scores.size(); ++i) {
            result = (result * scores.get(i)[1]) % MOD;
        }

        return (int) result;
    }
}
